-- DROP EXISTING TABLES --
DROP TABLE IF EXISTS `mlb_batting`;
DROP TABLE IF EXISTS `mlb_pitching`;
DROP TABLE IF EXISTS `mlb_manager`;
DROP TABLE IF EXISTS `mlb_team`;
DROP TABLE IF EXISTS `mlb_master`;

-- CREATE MLB_TEAM TABLE --

CREATE TABLE `mlb_team` (
  `team_id` varchar(3) NOT NULL DEFAULT '',
  `league` varchar(2) DEFAULT '',
  `division` varchar(1) DEFAULT NULL,
  `rank` int(11) DEFAULT NULL,
  `games` int(11) DEFAULT NULL,
  `wins` int(11) DEFAULT NULL,
  `losses` int(11) DEFAULT NULL,
  `won_div` varchar(1) DEFAULT NULL,
  `won_wc` varchar(1) DEFAULT NULL,
  `won_lg` varchar(1) DEFAULT NULL,
  `won_ws` varchar(1) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `park` varchar(255) DEFAULT NULL,
  `attendance` int(11) DEFAULT NULL,
  PRIMARY KEY (`team_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- CREATE MLB_MASTER TABLE --

CREATE TABLE `mlb_master` (
  `player_id` varchar(10) NOT NULL,
  `name_first` varchar(50) DEFAULT NULL,
  `name_last` varchar(50) DEFAULT NULL,
  `birth_year` int(11) DEFAULT NULL,
  `birth_month` int(11) DEFAULT NULL,
  `birth_day` int(11) DEFAULT NULL,
  `weight` int(11) DEFAULT NULL,
  `height` double DEFAULT NULL,
  `bats` varchar(1) DEFAULT NULL,
  `throws` varchar(1) DEFAULT NULL,
  `debut` datetime DEFAULT NULL,
  `final_game` datetime DEFAULT NULL,
  PRIMARY KEY (`player_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- CREATE MLB_MANAGER TABLE --

CREATE TABLE `mlb_manager` (
  `team_id` varchar(3) NOT NULL DEFAULT '',
  `stint` int(11) NOT NULL DEFAULT '0',
  `player_id` varchar(10) DEFAULT NULL,
  `games` int(11) DEFAULT NULL,
  `wins` int(11) DEFAULT NULL,
  `losses` int(11) DEFAULT NULL,
  `rank` int(11) DEFAULT NULL,
  PRIMARY KEY (`team_id`,`stint`),
  KEY `manager_master_fk_idx` (`player_id`),
  CONSTRAINT `manager_team_fk` FOREIGN KEY (`team_id`) REFERENCES `mlb_team` (`team_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `manager_master_fk` FOREIGN KEY (`player_id`) REFERENCES `mlb_master` (`player_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- CREATE MLB_PITCHING TABLE --

CREATE TABLE `mlb_pitching` (
  `player_id` varchar(9) NOT NULL DEFAULT '',
  `stint` int(11) NOT NULL DEFAULT '0',
  `team_id` varchar(3) DEFAULT NULL,
  `wins` int(11) DEFAULT NULL,
  `losses` int(11) DEFAULT NULL,
  `games` int(11) DEFAULT NULL,
  `complete_games` int(11) DEFAULT NULL,
  `shut_outs` int(11) DEFAULT NULL,
  `saves` int(11) DEFAULT NULL,
  `outs_pitched` int(11) DEFAULT NULL,
  `hits` int(11) DEFAULT NULL,
  `earned_runs` int(11) DEFAULT NULL,
  `homeruns` int(11) DEFAULT NULL,
  `walks` int(11) DEFAULT NULL,
  `strikeouts` int(11) DEFAULT NULL,
  `opp_batting_avg` double DEFAULT NULL,
  `era` double DEFAULT NULL,
  `intentional_walks` int(11) DEFAULT NULL,
  `wild_pitches` int(11) DEFAULT NULL,
  `hit_by_pitch` int(11) DEFAULT NULL,
  `runs_allowed` int(11) DEFAULT NULL,
  PRIMARY KEY (`player_id`,`stint`),
  KEY `pitching_team_fk_idx` (`team_id`),
  CONSTRAINT `pitching_master_fk` FOREIGN KEY (`player_id`) REFERENCES `mlb_master` (`player_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `pitching_team_fk` FOREIGN KEY (`team_id`) REFERENCES `mlb_team` (`team_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- CREATE MLB_BATTING TABLE --

CREATE TABLE `mlb_batting` (
  `player_id` varchar(9) NOT NULL DEFAULT '',
  `stint` int(11) NOT NULL DEFAULT '0',
  `team_id` varchar(3) DEFAULT NULL,
  `games` int(11) DEFAULT NULL,
  `at_bats` int(11) DEFAULT NULL,
  `runs` int(11) DEFAULT NULL,
  `hits` int(11) DEFAULT NULL,
  `doubles` int(11) DEFAULT NULL,
  `triples` int(11) DEFAULT NULL,
  `homeruns` int(11) DEFAULT NULL,
  `rbi` int(11) DEFAULT NULL,
  `stolen_bases` int(11) DEFAULT NULL,
  `caught_stealing` int(11) DEFAULT NULL,
  `base_on_balls` int(11) DEFAULT NULL,
  `strikeouts` int(11) DEFAULT NULL,
  `intentional_walks` int(11) DEFAULT NULL,
  `hit_by_pitch` int(11) DEFAULT NULL,
  PRIMARY KEY (`player_id`,`stint`),
  KEY `batting_team_fk_idx` (`team_id`),
  CONSTRAINT `batting_team_fk` FOREIGN KEY (`team_id`) REFERENCES `mlb_team` (`team_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `batting_master_fk` FOREIGN KEY (`player_id`) REFERENCES `mlb_master` (`player_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

